import React from "react";
import "../css/AppBar.css";

function AppBar () {
  return (
    <div className="appBar"> 
        <button> <h2>About</h2> </button>
        <button onClick="document.getElementById('middle').scrollIntoView();" ><h2> Education </h2></button>
    </div>
  )
}

export default AppBar;
